import React from "react";
import Home from "./pages/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Layout from "./layout/home/Layout";
import ProductsNavbar from "./layout/products/ProductsNavbar";
import Products from "./pages/Products";
import Hoodies from "./layout/products/Hoodies";
import TShirts from "./layout/products/TShirts";
import SweatShirts from "./layout/products/SweatShirts";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="/products" element={<ProductsNavbar />}>
            <Route index element={<Products />} />
            <Route path="hoodies" element={<Hoodies />} />
            <Route path="tshirts" element={<TShirts />} />
            <Route path="sweatshirts" element={<SweatShirts />} />
          </Route>
          <Route path="/contact" element={<Contact />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
